// --- DYNAMIC SETUP ---

// 1. Get the raw string from the 'data' key (Your correct fix!)
const rawSerpDataString = $input.first().json.data; 

// 2. THIS IS THE KEY: Parse that string into a proper JSON object
const serpApiOutput = JSON.parse(rawSerpDataString);

// 3. Now we can safely access the organic_results
const organicResults = serpApiOutput.organic_results || [];

// 4. Get our AI's analysis from the VERY FIRST Gemini node in the loop
// **IMPORTANT**: This line assumes your first Gemini analyzer node is named 'Basic LLM Chain'
const ourPageAnalysis = $('AI Analyzer').first().json.output;

// --- INTELLIGENT "BAG OF WORDS" ALLOWLIST ---

// 5. Combine all our keywords into one big string
const allKeywordsString = [ourPageAnalysis.primary_keyword, ...ourPageAnalysis.semantic_keyword_cluster].join(' ');

// 6. Define common "stop words" to ignore
const stopWords = new Set(['a', 'an', 'and', 'the', 'for', 'to', 'in', 'of', 'with', 'on', 'is', 'it', 'custom', 'websites', 'services']);

// 7. Create our dynamic "bag of words"
const allowlist = allKeywordsString
  .toLowerCase()
  .split(/\s+/) // Split by spaces
  .filter(word => word.length > 2 && !stopWords.has(word)); // Remove short words and stop words

const cleanedResults = [];

for (const result of organicResults) {
  const title = result.title ? result.title.trim() : '';
  const description = result.snippet ? result.snippet.trim() : '';
  const link = result.link ? result.link.trim() : '';

  const textToScan = (title + ' ' + description).toLowerCase();

  // --- DYNAMIC FILTERING LOGIC ---
  // Check if the competitor text contains ANY of the words from our "bag of words"
  const isRelevant = allowlist.some(keyword => textToScan.includes(keyword));

  if (title && description && link && isRelevant) {
    cleanedResults.push({
      title: title,
      description: description,
      link: link
    });
  }
}

// We only need the top 5-7 for AI analysis
const topRelevantResults = cleanedResults.slice(0, 7);

// Pass the cleaned results to the next node
return [{ json: { competitor_data_for_ai: topRelevantResults } }];

// Get the messy text output from the Master Generator AI
const messyText = $json.text || '';

// This regex finds and extracts ONLY the JSON part, ignoring everything else
const match = messyText.match(/\{[\s\S]*\}/);

let finalOutput = {};

if (match && match[0]) {
  try {
    // Try to parse the clean JSON string
    finalOutput = JSON.parse(match[0]);
  } catch (error) {
    // If parsing fails, create an error object
    finalOutput = {
      optimized_title: 'PARSE_ERROR',
      optimized_meta: `Failed to parse JSON: ${error.message}`
    };
  }
} else {
  // If no JSON is found at all, create an error object
  finalOutput = {
    optimized_title: 'NO_JSON_FOUND',
    optimized_meta: 'The AI did not return a valid JSON object.'
  };
}

// Pass the perfect, clean JSON object to the next node
return [{ json: finalOutput }];

// Get the JSON string directly from the 'text' property
const jsonString = $json.text || '{}';

let finalOutput = {};

try {
  // Try to parse the clean JSON string
  finalOutput = JSON.parse(jsonString);
} catch (error) {
  // If parsing fails for any reason, create an error object
  finalOutput = {
    optimized_title: 'PARSE_ERROR',
    optimized_meta: `Failed to parse JSON from AI: ${error.message}`
  };
}

// Pass the final JSON object to the next node
return [{ json: finalOutput }];

